import Header from "./components/Header";
import ContentBlock from "./components/ContentBlock";
import GlobalStyled from "./components/styled/GlobalStyled";

function App({ children }) {
  return (
    <GlobalStyled>
      <div className="App">
        <Header />
        <ContentBlock />
      </div>
    </GlobalStyled>
  );
}

export default App;
